import React from 'react'
import {Link} from 'react-router-dom';
import {
    Navbar,
    Nav,
    NavItem,
    NavbarBrand,
    Container
} from 'reactstrap';

export const Heading = () => {
    return (
        
        <Navbar color="dark" dark>
            <Container>
                <NavbarBrand href="/">LIST</NavbarBrand>
                    <Nav>
                    <NavItem>
                    <Link className="btn btn-primary" to="/add">ADD</Link>
                    </NavItem> 
                    </Nav>
            </Container>
        
        </Navbar>

    )
}
